  Code = "class Solution:\n    def duplicateZeros(self, arr: List[int]) -> None:\n        \"\"\"\n        Do not return anything, modify arr in-place instead.\n        \"\"\"\n        queue = deque()\n        for i in range(len(arr)):\n            num = arr[i]\n            if queue:\n                arr[i] = queue.popleft()\n                queue.append(num)\n            if num == 0:\n                queue.append(0)"
